The system can be cleanly split into 4 major components with well defined concerns. This allows for pluggable components (e.g. replacing the MIPS execution with another instruction set like RISCV) and reusing existing implementations. classDiagram
class Executor { +step(snapshotHash) newSnapshotHash
} class ExecutorIO { +readOutput(snapshotHash) data +writeInput(snapshotHash, input) newSnapshotHash
} class GCOrchestrator { +newChallenge(startAndEndSnapshots, challengeParams) challengeId +dissectChallenge(challengeId, faultAssertion, newSnapshots) +proveChallenge(challengeId, faultAssertion) +timeoutChallenge(challengeId)
} class Zipline { +submit(epochNumber, updateHash, blockRoot) +challenge(submissionId, finalSnapshotHash, nSteps) +finalize(submissionId)
} Zipline --|> GCOrchestrator
GCOrchestrator --> Executor
Zipline --> ExecutorIO
